        <h1 className="text-4xl font-bold mb-4">Hi, I'm Benjamin Ayesu-Attah</h1>
        <p className="text-lg text-gray-600 mb-8">
          Passionate Software Developer with a focus on Frontend, Backend and Mobile development.
